import React from 'react';
import './Internship.css';

function Internship() {
  return (
    <section className="internship" id="internship" data-aos="fade-up">
      <h2 className="section-title">Internship</h2>
      <div className="internship__content">
        <h3>Generative AI Intern</h3>
        <p>Worked with regression and deep learning models to solve real-world problems and gain hands-on experience in AI and machine learning.</p>
      </div>
    </section>
  );
}

export default Internship;
